import React from 'react';
import {Route, Switch } from 'react-router-dom';
import './App.css';
import {Login} from './Login/Login';
import {Register} from './Register/Register';
import {Profile} from './Profile/Profile';
import {Error404} from './404/404';

function App() {
    return (
        <div className="App">
            <Switch>
                <Route path="/login"
                       render={() => <Login/>}/>
                <Route path="/register"
                       render={() => <Register/>}/>
                <Route path="/profile"
                       render={() => <Profile/>}/>
                <Route exact path="*"
                       render={() => <Error404/>}/>
            </Switch>
        </div>
    );
}

export default App;
